%% Classifier design
% Study the the data and the complexity of the multi-class classification problem
% The dataset consists of three classes with slightly unbalanced
% distributions. Based on the scatter plots, the problem seems quite
% complex and the classes overlap significantly in the two-dimensional
% feature space.


