%[text] ## Implement two supervised classification models that are reasonable for solving the problem
rng('default');
Xtrain = traindata_std;
Xtest = testdata_std;
Ytrain = trainclass;
Ytest = testclass;
numTrees = [1 5 10 20 50 100];

% Decision tree
T = fitctree(Xtrain, Ytrain);
Ypred_single = predict(T, Xtest);
acc_single = mean(Ypred_single == Ytest);
fprintf('Single tree accuracy: %.3f\n', acc_single); %[output:6a9af486]

%confusion matrix:
C = confusionmat(testclass, Ypred_single);

% Plot confusion matrix
figure; %[output:8201b714]
confusionchart(C); %[output:8201b714]
title(sprintf('Confusion Matrix (decision tree), accuracy: %.3f', acc_single)); %[output:8201b714]
xlabel('Predicted Class'); %[output:8201b714]
ylabel('True Class'); %[output:8201b714]


% Random forest
trainFracs = [0.7 0.8 0.9];
Acc = nan(numel(trainFracs), numel(numTrees));

for tf = 1:numel(trainFracs) % how much data we use in bootstrap %[output:group:1f0ffa41]
    trainFrac = trainFracs(tf);
    fprintf("Size of the training subset (bootstrap): %.1f\n", trainFrac) %[output:1643078c] %[output:9ae1fe29] %[output:5c3fcb9e]
    % Classifier training
    for nt = 1:numel(numTrees)
        nT = numTrees(nt);
        preds = zeros(numel(Ytest), nT);
        for i = 1:nT
            % Bootstrap sample
            N = round(trainFrac * size(Xtrain,1));
            idx = randsample(size(Xtrain,1), N, true);
            Xi = Xtrain(idx, :);
            Yi = Ytrain(idx);
            % Decision tree
            tree = fitctree(Xi, Yi);
            % Predictions to test data
            preds(:,i) = predict(tree, Xtest);
        end
        % Voting
        Yhat = mode(preds, 2);
        acc = mean(Yhat == Ytest);
        Acc(tf, nt) = acc; 
        fprintf('Random Forest accuracy, %d trees: %.3f\n', nT, acc); %[output:02cdd9a4] %[output:93830dc8] %[output:51257104] %[output:3f409ef7]
        if (nT == 50) && (trainFrac == 0.8)
            C = confusionmat(Ytest, Yhat);
    
            % Plot confusion matrix
            figure; %[output:66be37d2]
            confusionchart(C); %[output:66be37d2]
            title(sprintf('Confusion Matrix (random forest), accuracy: %.3f', acc));
            xlabel('Predicted Class');
            ylabel('True Class');
        end
    end
end %[output:group:1f0ffa41]

figure; hold on %[output:9bd632cf]
